import axiosClient from "./axiosClient";

export const merchantApi = {
    getMerchantId: (id: string) => {
        const url = `/traffic-source/${id}/qrcode`;
        return axiosClient.get(url);
    },
    getMerchantConfig: ()=> {
        const url ="/auth/merchant-config";
    },
};
